import React, { Component } from 'react';


class ClassPage extends Component {
    state = {
        isLoaded:false,
        classes:[],
    }
    componentWillMount(){
        fetch('http://dnd5epi.co/classes')
            .then(res=>res.json())
            .then(json => {
                this.setState({
                    isLoaded:true,
                    classes:json.results,
                })
            });
    }
    render() { 
        return (
            <div>{console.log(this.state.classes)}</div>
        );
    }
}
 
export default ClassPage;
